import React, { useContext } from "react";
import { CartContext } from "../CartContext";

const products = [
  { id: 1, name: "Burger", price: 5, image: "data:image/jpeg;base64," },
  { id: 2, name: "Pizza", price: 8, image: "data:image/jpeg;base64," },
  { id: 3, name: "Coffee", price: 3, image: "data:image/jpeg;base64," },
  { id: 4, name: "Cheez Burger", price: 5, image: "data:image/jpeg;base64," },
  { id: 5, name: "Crown Crust Pizza", price: 8, image: "data:image/jpeg;base64," },
  { id: 6, name: "Coffee", price: 3, image: "data:image/jpeg;base64," },
{ id: 7, name: "Zinger Burger", price: 5, image: "data:image/jpeg;base64," },
  { id: 8, name: "Malai Boti Pizza", price: 8, image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRFvYuXX16Tg1FwgdA72sUW5f4lbxEDMaDKmeMU6STMp7JM2TC_9sOzXag&s" },
  { id: 9, name: "Cold Coffee", price: 3, image: "data:image/jpeg;base64," },
  { id: 10, name: "Mighty Burger", price: 5, image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQuiutixbk97rCOQZeIzRVwEhBecRvtLPeV5w&s" },
  { id: 11, name: "Fajita Pizza", price: 8, image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSyJ84MxnkKD1EOnfHJpXXup-02jgQYNQFIXD9S47yhhGdnLKEVGZo3Tu8&s" },
  { id: 12, name: "ice Coffee", price: 3, image: "data:image/jpeg;base64," },
];


const Menu = () => {
  const { cart, setCart } = useContext(CartContext);

  const addToCart = (product) => {
    const existing = cart.find(item => item.id === product.id);
    if (existing) {
      setCart(cart.map(item => item.id === product.id ? { ...item, qty: item.qty + 1 } : item));
    } else {
      setCart([...cart, { ...product, qty: 1 }]);
    }
  };

  return (
   
  
    
    <div className="menu-container">
      < div className="menu-header">
        <h1>Our Menu</h1>
        <p>Explore our delicious range of coffees and treats</p>
      </div>
      {products.map((item) => (
        <div key={item.id} className="menu-item">
          <img src={item.image} alt={item.name} />
          <h3>{item.name}</h3>
          <p>${item.price}</p>
          <button onClick={() => addToCart(item)}>Add to Cart</button>
        </div>
      ))}
    </div>
  );
};

export default Menu;
